// Load Stylesheet in the dom before the document ready.
if($.cookie("css")) {
    $("link[rel=stylesheet]").attr("href",$.cookie("css"));
    $("html").attr("dir", $.cookie("dir")).attr("lang", $.cookie("lang"));
}
$(function() {

    $(".lang-ar").click(function() {
        $("link[rel=stylesheet]").attr("href",$(this).attr('rel'));
        $("html").attr("dir",$(this).attr('data-dir'));
        $.cookie("css",$(this).attr('rel'), {expires: 1, path: '/'});
        $.cookie("dir",$(this).attr('data-dir'), {expires: 1, path: '/'});
        $.cookie("lang",$(this).attr('data-lang'), {expires: 1, path: '/'});
        return false;
    });

    function isRTL(){
        return $('html').attr('dir') === 'rtl';
    }

    $(".product-slider").slick({
        rtl: isRTL(),
        dots: true,
        arrows: false,
        slidesToShow: 4,
        slidesToScroll: 4,
        waitForAnimate: true,
        useTransform: true,
        autoplay: true,
        autoplaySpeed: 5000,
        speed: 600,
        cssEase: 'cubic-bezier(0.455, 0.030, 0.130, 1.000)',
        responsive: [
            {
                breakpoint: 900,
                settings: {
                    slidesToShow: 3,
                    slidesToScroll: 3
                }
            },
            {
                breakpoint: 600,
                settings: {
                    slidesToShow: 2,
                    slidesToScroll: 2
                }
            },
            {
                breakpoint: 576,
                settings: {
                    slidesToShow: 1,
                    slidesToScroll: 1
                }
            }
        ]
    });

    $(".brands-slider").slick({
        rtl: isRTL(),
        dots: true,
        arrows: false,
        slidesToShow: 5,
        slidesToScroll: 5,
        waitForAnimate: true,
        useTransform: true,
        autoplay: true,
        autoplaySpeed: 5000,
        speed: 600,
        cssEase: 'cubic-bezier(0.455, 0.030, 0.130, 1.000)',
        responsive: [
            {
                breakpoint: 900,
                settings: {
                    slidesToShow: 4,
                    slidesToScroll: 4
                }
            },
            {
                breakpoint: 600,
                settings: {
                    slidesToShow: 2,
                    slidesToScroll: 2
                }
            },
        ]
    });
    ////// Product Rate
    $('select.rate-product').barrating({
        theme: 'fontawesome-stars',
        readonly: 'true'
    });

    // Products View Card change
    var productView = $('.product-view');

    $('.switch').find("li").click(function () {
        if ($(this).hasClass("grid")) {
            productView.removeClass("tag-view").removeClass("list-view").addClass("grid-view");
            $('.list,.tag').removeClass("active");
            $(this).addClass("active");
        } else {
            productView.removeClass("grid-view").removeClass("tag-view").addClass("list-view");
            $('.tag,.grid').removeClass("active");
            $(this).addClass("active");
        }
    });


    $(".quick-view").slick({
        rtl: isRTL(),
        dots: true,
        arrows: false,
        slidesToShow: 1,
        slidesToScroll: 1,
        waitForAnimate: true,
        useTransform: true,
        autoplay: true,
        autoplaySpeed: 5000,
        speed: 600,
        cssEase: 'cubic-bezier(0.455, 0.030, 0.130, 1.000)',
    });

    // Fixs first slide that doesn't appear
    $('.modal').on('shown.bs.modal', function () {
        $('.quick-view')[0].slick.setPosition();
    });

    $("#new-address").click(function (e) {
        e.preventDefault();
        $(".new-address").slideDown();
    });

    $(".sign-up").on("click", function () {
        $("[data-target='#signUp']").trigger("click");
    });

    //Initialize tooltips
    $('.nav-tabs > li a[title]').tooltip();

    //Wizard
    $('a[data-toggle="tab"]').on('show.bs.tab', function (e) {

        var $target = $(e.target);

        if ($target.parent().hasClass('disabled')) {
            return false;
        }
    });

    $(".next-step").click(function (e) {
        var $active = $('.wizard .nav-tabs li.active');
        $active.next().removeClass('disabled');
        nextTab($active);
    });

    $(".prev-step").click(function (e) {
        var $active = $('.wizard .nav-tabs li.active');
        prevTab($active);
    });

    function nextTab(elem) {
        $(elem).next().find('a[data-toggle="tab"]').click();
    }
    function prevTab(elem) {
        $(elem).prev().find('a[data-toggle="tab"]').click();
    }

    $( document ).on( 'click', '.bs-dropdown-to-select-group .dropdown-menu li', function(e) {
        var $target = $( e.currentTarget );
        $target.closest('.bs-dropdown-to-select-group')
                .find('button input').val($target.attr('data-value'))
                .end()
                .children('.dropdown-toggle').dropdown('toggle');

        $target.closest('.bs-dropdown-to-select-group')
                .find('button .label-name').text($target.attr('data-value'));
        return false;
    });

    // var elements = $('.sticky');
    // Stickyfill.add(elements);

    $( "#datepicker-from,#datepicker-to" ).datepicker();

    // Custom upload file
    document.querySelector("html").classList.add('js');

    var fileInput  = $( "[id^=my-file]" ),
        button     = $( ".input-file-trigger" ),
        the_return = $( ".file-return" );

    button.on( "keydown", function( event ) {
        if ( event.keyCode == 13 || event.keyCode == 32 ) {
            $(this).siblings().trigger("click");
        }
    });

    button.on( "click", function( event ) {
        $(this).siblings().trigger("click");
        return false;
    });

    fileInput.on( "change", function( event ) {
        $(this).parent().siblings().html(this.value);
    });
    
    
    $(".day").click(function () {
        $(".form-container").slideUp();
        $(".select-meals").slideDown();

        $(".product-item").click(function () {
            $(this).toggleClass("active")
        })
    });

    $(".main-history a.timeline-content").click(function(e){
        e.preventDefault();
        $(".timeline .me-c").hide();
        $(this).siblings().show();
    });

    $(".side-toggle").click(function () {
        $(this).addClass("active");
        $("#sidebar-menu").addClass("active");
        $('body').prepend($('<div class="side-close"></div>'));
    });

    $(document).on("click", ".side-close",function () {
        $(".side-toggle").removeClass("active");
        $("#sidebar-menu").removeClass("active");
        $(this).remove();
    });

    // Scroll to top
    function scrollTopDiv() {
        $('html, body').animate({
            scrollTop: $(".nav-tabs").offset().top - 30
        }, 400);
    }

    // Footer nav links lead to it's tab
    var hash = document.location.hash;
    if (hash) {
        $(".account-tabs li").removeClass("active");
        $(".account-tabs a[href=\\"+hash+"]").tab('show').parent().addClass("active");
        scrollTopDiv();
    }

    // Prevent scrolling in other pages
    if ($('.account-tabs').length) {
        $("#nav-tabs a").click(function () {
            scrollTopDiv();
        });
    };


    // Custom radio BTNS
    $('#radioBtn a').on('click', function(){
        var sel = $(this).data('title');
        var tog = $(this).data('toggle');
        $('#'+tog).prop('value', sel);

        $('a[data-toggle="'+tog+'"]').not('[data-title="'+sel+'"]').removeClass('active').addClass('notActive');
        $('a[data-toggle="'+tog+'"][data-title="'+sel+'"]').removeClass('notActive').addClass('active');

        if ($(this).data('title') === "Other") {
            $("#custom-name").slideDown();
        } else {
            $("#custom-name").slideUp();
        }
    });

    $("#pickDate").datetimepicker({
        format: 'L',
    });
    $("#pickTime").datetimepicker({
        format: 'LT',
    });

});

